// Preload Futura font
// The font is encoded as base64 data URI because Chrome can't open local files ("Cross origin requests are only supported for ...")
// Generated using http://dopiaza.org/tools/datauri/index.php
var FuturaLTBook = "data:application/octet-stream;base64,"

// Workaround for "fs.readFileSync is not a function" in pdfkit
// From http://stackoverflow.com/questions/26392735/pdfkit-custom-fonts-fs-readfilesync-is-not-a-function
var oReq = new XMLHttpRequest();
var arrayBuffer;

oReq.open("GET", FuturaLTBook, true);
oReq.responseType = "arraybuffer";

oReq.onload = function(oEvent) {
    arrayBuffer = oReq.response; // Note: not oReq.responseText
};

oReq.send(null);

// Generate the mug!
function GenerateMug(img) {
    // Design constants (inches)
    var cutout_width = 4.25;
    var cutout_height = 6.5;
    var circle_x_distance = 3.5;
    var circle_y_distance = 5.75;
    var circle_radius = 0.125/2;
    var page_width = 8.5;
    var page_height = 11;
    var photo_width = 3.5;
    var photo_height = 5.25;
    var name = document.getElementById('name').value;
    
    // Create document
    var mug = new PDFDocument({ margin : 0 });
    
    // Create blob-stream to output file
    var outpdf = mug.pipe(blobStream());
    
    // Register font previously loaded
    mug.registerFont('Futura LT', arrayBuffer);

    // Note: PDF dimensions are points (72pt/inch)
    // Create rectangle
    mug.rect((page_width - cutout_width)/2 * 72, (page_height - cutout_height)/2 * 72, cutout_width * 72, cutout_height * 72).stroke();
    // Create circles
    mug.circle((page_width - circle_x_distance)/2 * 72, (page_height - circle_y_distance)/2 * 72, circle_radius * 72).stroke();
    mug.circle((page_width + circle_x_distance)/2 * 72, (page_height - circle_y_distance)/2 * 72, circle_radius * 72).stroke();
    mug.circle((page_width - circle_x_distance)/2 * 72, (page_height + circle_y_distance)/2 * 72, circle_radius * 72).stroke();
    mug.circle((page_width + circle_x_distance)/2 * 72, (page_height + circle_y_distance)/2 * 72, circle_radius * 72).stroke();
    
    // Print name
    mug.font('Futura LT', 20);
    mug.text(name, (page_width/4) * 72, (page_height + circle_y_distance - 6 * circle_radius)/2 * 72, { align : 'center', width : (cutout_width * 72) });

    // Add photo
    var photo_x = (page_width - circle_x_distance)/2 * 72;
    var photo_y = (page_height - circle_y_distance)/2 * 72;
    mug.image(img, photo_x, photo_y, { width: photo_width * 72 });
    
    // Done!
    mug.flushPages();
    mug.end();
    
    // Output PDF file
    outpdf.on('finish', function() {
        // Using stream.toBlobURL() works, but filename is a GUID of some sort
        // This gives the PDF a proper name
        var blob = outpdf.toBlob('application/pdf');
        saveAs(blob, name + '.pdf');
    });
   
}
            
